package control;

public class tkb {
	private String MAPHONG;
	private String TENMH;
	private String THU;
	private int STC;
	private int CA;
	public tkb() {
		super();
		// TODO Auto-generated constructor stub
	}
	public tkb(String mAPHONG, String tENMH, String tHU, int sTC, int cA) {
		super();
		MAPHONG = mAPHONG;
		TENMH = tENMH;
		THU = tHU;
		STC = sTC;
		CA = cA;
	}
	/**
	 * @return the mAPHONG
	 */
	public String getMAPHONG() {
		return MAPHONG;
	}
	/**
	 * @param mAPHONG the mAPHONG to set
	 */
	public void setMAPHONG(String mAPHONG) {
		MAPHONG = mAPHONG;
	}
	/**
	 * @return the tENMH
	 */
	public String getTENMH() {
		return TENMH;
	}
	/**
	 * @param tENMH the tENMH to set
	 */
	public void setTENMH(String tENMH) {
		TENMH = tENMH;
	}
	/**
	 * @return the tHU
	 */
	public String getTHU() {
		return THU;
	}
	/**
	 * @param tHU the tHU to set
	 */
	public void setTHU(String tHU) {
		THU = tHU;
	}
	/**
	 * @return the sTC
	 */
	public int getSTC() {
		return STC;
	}
	/**
	 * @param sTC the sTC to set
	 */
	public void setSTC(int sTC) {
		STC = sTC;
	}
	/**
	 * @return the cA
	 */
	public int getCA() {
		return CA;
	}
	/**
	 * @param cA the cA to set
	 */
	public void setCA(int cA) {
		CA = cA;
	}
	
}
